import React, { useState } from 'react';

function App() {
  const [data, setData] = useState(null);

  React.useEffect(() => {
    fetch("/api")
      .then((res) => res.json())
      .then((data) => setData(data.message));
  }, []);

  return (
    <div className="App">
      {data}
      <p>{!data ? "Loading...": data}</p>
    </div>
  );
}

export default App;
